import React from "react";
import { Card } from "../../UI/Card.styled";
import { ImageCard } from "../../UI/ImageCard.styled";
const NavBar = ({ UI }) => {
  const navList = ["About", "Projects", "Resume", "Contact"];
  const renderedNavList = navList.map((index) => {
    return <Card fs={"0.7rem"}>{index}</Card>;
  });
  return (
    <Card
      mg={"1rem 7.5%"}
      height={"2rem"}
      width={"85%"}
      // bd={"1px solid red"}
      dp={"grid"}
      gridC={"28% 35% 37%"}
      //   ovfx={"hidden"}
    >
      <Card bd={"3px solid red"}>
        <ImageCard
          src={UI.userIcon}
          heigth={"1.6rem"}
          width={"1.6rem"}
          mg={"0rem 0rem -0.5rem 0rem"}
        />
        <Card
          fs={"0.8rem"}
          fw={"700"}
          ps={"relative"}
          pstp={"0.4rem"}
          mg={"0rem 0.5rem"}
          dp={"inline"}
        >
          Marvel
        </Card>
      </Card>
      <Card dp={"grid"} gridC={"auto auto auto auto"} bd={"1px solid red"}>
        {renderedNavList}
      </Card>
      <Card bd={"1px solid red"}></Card>
    </Card>
  );
};

export default NavBar;
